import React, { Component } from 'react'

export class HomePage extends Component {

    constructor(props){
        super(props)
        this.state ={
            email: '',
            password: ''
        }
    }

    handleChange(e){
        this.setState({[e.target.name]: e.target.value})
    }

    render() {
        return (
          <div>
            <div className="splash"></div>
            <div className="container">
              <div className="left">
                <img
                  src="https://images.pexels.com/photos/1036808/pexels-photo-1036808.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
                  alt=""
                />
                <div className="splash-text">
                  <h1 className="name">Home Inspiration</h1>
                  <p>
                    Lorem ipsum dolor sit amet consectetur adipisicing elit.
                    Ipsum, explicabo officia repellendus,
                  </p>
                  <input type="submit" value="Enter"/>
                </div>
              </div>
              <div className="middle"></div>
              <div className="right"></div>
              <div className="bottom">
                <p className="footer">Copyright 2020</p>
              </div>
            </div>
          </div>
        );
    }
}

export default HomePage
